How to make sure fs.createWriteStream finishes before function continues; only fraction of image being saved<p>I am making a request to an API to get a path to an image. I want to save this image to my database in a mongoDB collection so that the users don't need to constantly make API requests.</p>

<p>I have something set up where I make a request to the imagePath and with the response, I pipe fs.createWriteStream().</p>

<p>Then later on in the code, I use my schema to create a "Character" using this file. It works, but it only saves a fraction of the image, like a top 1/5th. It's not finishing before it continues. </p>

<p>I tried making the function async and then using await before my url request. I have also tried various express/fs methods, like writeFileSync() but those haven't worked.</p>

<p>How do I get the file to finish writing before it does the mongoDB dance?</p>

<pre><code>
 let imagePath = req.body.characterObject.thumbnail.path + '.' + req.body.characterObject.thumbnail.extension;

 let superPath = './uploads/marvelousImage.jpg';
let marvelousImage;
  axios({
      url: imagePath,
      responseType: 'stream',
  })
  .then(response =&gt; {
      marvelousImage = response.data.pipe(fs.createWriteStream(superPath));

  })
  .catch(err =&gt; {
      console.log(err)
  });

    User.findOne({  "username": "administrator"})
    .then(user =&gt; {
      let characterId = req.body.characterObject.id;
      for(let i = 0; i &lt; user.characters.length; i++) {
        if(characterId == user.characters[i].id) {
          return Promise.reject({
            code: 422,
            message: 'You already have this character!',
            reason: "CharacterDuplicationError"
          });
        }
      }
      console.log(req.body.characterObject);
      Character.create({
          description: req.body.characterObject.description || 'bocho',
          events: req.body.characterObject.events || 'lopo',
          thumbnail: req.body.characterObject.thumbnail || 'goso',
          name: req.body.characterObject.name || 'John Doe',
          id: req.body.characterObject.id,
          "image.data": fs.readFileSync(superPath),
          "image.contentType": 'image/jpeg'
      })
      .then(char =&gt; {
          console.log('lalala');
          console.log(char);
        user.characters.push(char);
        user.save();
        return res.status(201).json({message: "Character Added!"})
      })
    .catch(err =&gt; {
        if(err.reason === "CharacterDuplicationError") {
          return res.send(err);
        } 
    })
   })
 });
</code></pre>

