MongoDB pushing to multiple subdocuments in same query<p>I have a collection like this one.</p>

<pre><code>{
    "_id" : ObjectId("5d729d41b2f209e6f96034f0"),
    "selections" : [ 
        {
            "selectionId" : 1.0,
            "data" : [ 
                {
                    "value" : 1.0,
                    "index" : 1.0
                }, 
                {
                    "value" : 2.0,
                    "index" : 2.0
                }
            ]
        }, 
        {
            "selectionId" : 2.0,
            "data" : [ 
                {
                    "value" : 1.0,
                    "index" : 1.0
                }, 
                {
                    "value" : 2.0,
                    "index" : 2.0
                }
            ]
        }
    ]
}
</code></pre>

<p>And I can make two queries to update two subdocuments:</p>

<pre><code>db.getCollection('test').update(
    { 
        "_id": ObjectId("5d729d41b2f209e6f96034f0"),
        "selections.selectionId" : 1,
    },
    { 
        "$push": {
            "selections.$.data" : {
                    value: 3,
                    index: 3
                }
        }
    }
)

db.getCollection('test').update(
    { 
        "_id": ObjectId("5d729d41b2f209e6f96034f0"),
        "selections.selectionId" : 2,
    },
    { 
        "$push": {
            "selections.$.data" : {
                    value: 3,
                    index: 3
                }
        }
    }
)
</code></pre>

<p>Is it possible to do it in one query?</p>

<p>Edit: I tried the following query also from first answer:</p>

<pre><code>db.getCollection('test').update(
    {
        "_id": ObjectId("5d729d41b2f209e6f96034f0")
    }, 
    { 
        $push: { 
            "selections.$[s1].data": { value: 3, index: 3 }, 
            "selections.$[s2].data": { value: 4, index: 4 } 
        }
    },
    { 
        arrayFilters:
        [
            { "s1.selectionId": 1 },
            { "s2.selectionId": 2 }
        ]
    }
)
</code></pre>

<p>But it says:</p>

<pre><code>&gt; No array filter found for identifier 's1' in path
&gt; 'selections.$[s1].data'
</code></pre>

