consume rest auth api in nodejs<p>I have an api running at www.website.com/users/login .I want to consume the api in my nodejs frontend . I want pass the token received from /login to all other routes. Here i am trying to pass the token recieved after login to logout route.</p>

<p>Api logout code-</p>

<pre><code>router.post('/users/logout',auth, async(req,res)=&gt;{
    try{
        req.user.tokens=req.user.tokens.filter((token)=&gt;{
            return token.token !==req.token
        })

        await req.user.save()

        res.send()
    }catch(e){
        res.status(500).send()
    }
})
</code></pre>

<p>CLient side code</p>

<pre><code>app.post('/users/login', function (req, res) {

var email = req.body.email;
var password = req.body.password;
var form = {
    email,
    password
}

request.post({
    url: "https://website.com/users/login",
    body: form,
    json: true
}, function (error, response, body) {
    console.log('error:', error)
    console.log('body:', body.errmsg);
    console.log(body);
    if (body.user) {
        let auth = body.token
        console.log(auth) //I want to pass this auth to /logout
    } else {
        res.render('login', {
             email,
            password
        })
    }   
})
</code></pre>

<p>Logout route .I want to pass token to the logout route so that the user can logout?</p>

<pre><code>app.post('/users/logout', function (req, res, next) {
request.post({
        url: "https://website.com/users/logout",
        headers: {
            'Authorization': auth
        },
    }, function (error, response, body) {
        console.log('error:', error)
        console.log('response:', response);
        console.log('body:',body);
    })
})
</code></pre>

<p>Please help me understand how to use the token recieved from login to other routes. I had postman inherit from auth but i am having hard time to consume this api.</p>

