    const userSchema = new mongoose.Schema({
        name: {type: String},
        email: {type: String},
    });
    const user = mongoose.model('User', userSchema);

    // academic model
    const academicSchema = new mongoose.Schema({
        academicLevel: {type: String},
        passYear: {type: Number},
