How to use MongoDB aggregation to convert a string of key value pairs into a document<p>I am playing around with the MongoDB aggregation pipeline trying to see if I can use it to parse a file with the following format.</p>

<pre><code>FIELD1:ABC
FIELD2:DEF
...
FIELD12:YZ
RowData:__ __ 01 __ __
RowData:__ 02 01 01 __
RowData:__ __ 03 __ __
</code></pre>

<p>I have directly inserted the file stream into a mongo document into a field called fileStream.  Now I am trying to create a pipeline to add each field to the document.  I have been somewhat successful but I can't seem to get the keys with duplicate values into an array.  </p>

<p>Problem I am having is that any duplicate keys get over written with the last value.  </p>

<p>With This pipeline I get an array of arrays with element 0 being the key and element 1 being the value. So when I use $arrayToObject only the last field is retained for duplicate keys.  </p>

<pre><code>db.maps.aggregate([
  {
    $addFields: {
      'rows':
      {
        $map:
        {
          input: {
            // Sinf Rows
            $filter: {
              input: { $split: ['$fileStream', '\r\n'] },
              as: 'row',
              cond: { $ne: ['$$row', ''] }
            }
          },
          as: 'row',
          in:
            {
              $split: ['$$row', ':']
            }
        }
      }
    }
  }
]).pretty()
</code></pre>

<p>This pipeline is close but the RowData elements are not contained in a array.  </p>

<pre><code>db.maps.aggregate([
  {
    $addFields: {
      'rows':
      {
        $map:
        {
          input: {
            // Sinf Rows
            $filter: {
              input: { $split: ['$fileStream', '\r\n'] },
              as: 'row',
              cond: { $ne: ['$$row', ''] }
            }
          },
          as: 'row',
          in:
            {
              $cond: [{ $eq: [{ $arrayElemAt: [{ $split: ['$$row', ':'] }, 0] }, 'RowData'] }, { $arrayElemAt: [{ $split: ['$$row', ':'] }, 1] }, { $split: ['$$row', ':'] }]
            }
        }
      }
    }
  }
]).pretty()
</code></pre>

<p>I would like to combine any duplicate keys into the same array.  </p>

<p>So something like this</p>

<pre><code>"file": 
{
"FIELD1": "ABC"
...
"RowData": 
[
"__ __ 01 __ __",
"__ 02 01 01 __",
"__ __ 03 __ __"
]
}
</code></pre>

<p>I am able to do this in js using reduce but how can I accumulate into an array or object using the aggregation $reduce?</p>

