How do I define a different primary key other than _id in Mongoose?<p>I want to define Mongoose schemas with primary keys that are not <code>_id</code>. The documentation says it only allows the schema options flag <code>_id</code> to be set to false in subdocuments. Also, I want the primary key to be a <code>String</code> and not an <code>ObjectId</code>. Is that possible at all?</p>

<p>Using a secondary index is an option, but not a very good one since I want to have primary keys with proper names. I also don't want to fiddle around with two different indexes when I don't need to.</p>

<p>This sets <code>documentId</code> as a secondary index but that makes the primary key useless since I want to only select by <code>documentId</code> and not whatever <code>_id</code> ends up being set to automatically.</p>

<pre class="lang-js prettyprint-override"><code>const DocumentSchema = new Schema({
  documentId: { type: String, index: true }
})
</code></pre>

<p>I want to do something like </p>

<pre class="lang-js prettyprint-override"><code>const DocumentSchema = new Schema({
  documentId: String
